import React, { Component } from 'react';
import {Link} from "react-router-dom"
import {Menu} from '../../components'
import logo from '../../img/logo.png'
import './style.css'

class Nav  extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    shouldComponentUpdate(lastProp, nextProp) {
        console.log("props: ", this.props);
        console.log("lastProp: ", lastProp);
        if (lastProp.statusLogin !== this.props.statusLogin)
            return true
        return false
    }

    render() { 
    return (
    <>
        <div className="nav-menu">
        <div className="logo">
        <img src={logo} alt="logo-groceries"></img> 
        </div>
        <Link to="/"></Link>
        <Menu text="Home" class="first" goToPage={() => this.props.changePage("home")}></Menu>
        <Menu text="Makanan" goToPage={() => this.props.changePage("product")} />
        <Menu text="Minuman" goToPage={() => this.props.changePage("product")} />
        <Menu text="Snack" goToPage={() => this.props.changePage("product")} />
        <Menu text="Masuk" goToPage={() => this.props.changePage("login")} />
        <Menu text="Daftar" goToPage={() => this.props.changePage("daftar")} />
        </div>
    </>
    );
    }
}
export default Nav;
